import Vue from 'vue';
import Vuex from 'vuex';
import Auth from './store/auth';
import Socket from './store/socket';
import User from './store/user';

Vue.use(Vuex);

export default new Vuex.Store({
  modules: {
    Auth,
    Socket,
    User,
  },
});
